PROCEDURE Proc_employee_Update (IN v_EmployeeID char(36), IN v_EmployeeCode varchar(20), IN v_FullName varchar(100), IN v_DateOfBirth datetime, IN v_Gender int, IN v_DepartmentID char(36), IN v_DepartmentCode varchar(255), IN v_DepartmentName varchar(255), IN v_IdentityNumber varchar(255), IN v_IdentityDate datetime, IN v_PositionID char(36), IN v_PositionName varchar(255), IN v_PositionCode varchar(20), IN v_IdentityPlace varchar(255), IN v_Address varchar(255), IN v_PhoneNumber varchar(50), IN v_Email varchar(100), IN v_BankAccount varchar(255), IN v_BankName varchar(255), IN v_BankBranch varchar(255), IN v_HomePhoneNumber varchar(50), IN v_CreatedDate datetime, IN v_CreatedBy varchar(255), IN v_ModifiedDate datetime, IN v_ModifiedBy varchar(255))
