BEGIN
  UPDATE employee e
  SET e.EmployeeID = v_EmployeeID,
      e.EmployeeCode = v_EmployeeCode,
      e.FullName = v_FullName,
      e.DateOfBirth = v_DateOfBirth,
      e.Gender = v_Gender,
