  SET e.DepartmentCode = d.DepartmentCode,
      e.DepartmentID = d.DepartmentID
  WHERE e.DepartmentName = v_DepartmentName;

  UPDATE employee e, positions p
  SET e.PositionCode = p.PositionCode,
      e.PositionID = p.PositionID
  WHERE e.PositionName = v_PositionName;
