--
-- Create procedure `Proc_request_Filter`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_request_Filter (IN v_Where varchar(255), IN v_Offset varchar(255), IN v_Limit varchar(255), IN v_Status varchar(255), IN v_DepartmentId varchar(255))
BEGIN
  IF IFNULL(v_Where, '') = '' THEN
    SET v_Where = '';
  END IF;
  IF IFNULL(v_DepartmentId, '') = '' THEN
    SET v_DepartmentId = '';
  END IF;
  IF v_Status = -1 THEN
    SET v_Status = '';
  END IF;
  SET @filterQuery = CONCAT('select r.*, e.EmployeeCode, e.FullName, e.DepartmentID, e.PositionID, e1.FullName as ApprovedName from request r left join employee e on r.EmployeeID = e.EmployeeID left join employee e1 on r.ApprovedID = e1.EmployeeID where (e.EmployeeCode LIKE \'%', v_where, '%\'',
  ' OR e.FullName LIKE \'%', v_where, '%\')', ' AND r.Status LIKE \'%', v_Status, '%\'', ' AND e.DepartmentID LIKE \'%', v_DepartmentId, '%\'', ' ORDER BY r.ModifiedDate DESC', ' limit ', v_Limit, ' offset ', v_Offset);

  PREPARE filterQuery FROM @filterQuery;
  EXECUTE filterQuery;
  DEALLOCATE PREPARE filterQuery;

  SET @count = CONCAT('SELECT COUNT(*) from request r left join employee e on r.EmployeeID = e.EmployeeID left join employee e1 on r.ApprovedID = e1.EmployeeID where (e.EmployeeCode LIKE \'%', v_where, '%\'',
  ' OR e.FullName LIKE \'%', v_where, '%\')', ' AND r.Status LIKE \'%', v_Status, '%\'', ' AND e.DepartmentID LIKE \'%', v_DepartmentId, '%\'');

  PREPARE count FROM @count;
  EXECUTE count;
  DEALLOCATE PREPARE count;
END
$$

