  SET @count = CONCAT('select count(*) as ''Total'' from employee e where (e.EmployeeCode LIKE ''%', v_where, '%''',
  ' OR e.FullName LIKE ''%', v_where, '%''', ' OR e.Address LIKE \'%', v_where, '%\')', ' AND e.EmployeeID NOT IN ', v_IdEmployee);

  PREPARE count FROM @count;
  EXECUTE count;
